using System;
using System.IO;
using System.Runtime.Serialization.Formatters.Binary;
using Microsoft.VisualStudio.TestTools.UnitTesting;

namespace Zyan.SafeDeserializationHelpers.Tests
{
    [TestClass]
    public class YsoserialGadgetTests : TestBase
    {
        private void DeserializeMaliciousPayload(string comment, string base64)
        {
            var payload = Convert.FromBase64String(base64);
            using (var stream = new MemoryStream(payload))
            {
                var fmt = new BinaryFormatter().Safe();

                Assert_Throws<UnsafeDeserializationException>(() => fmt.Deserialize(stream),
                    $"Failed to detect malicious payload: {comment}");
            }
        }

        [TestMethod]
        public void TypeConfuseDelegateTest()
        {
            DeserializeMaliciousPayload("ysoserial.exe -o base64 -g TypeConfuseDelegate -f BinaryFormatter -c calc",
                @"");
        }

        [TestMethod]
        public void PSObjectTest()
        {
            DeserializeMaliciousPayload("ysoserial.exe -o base64 -g PSObject -f BinaryFormatter -c calc",
                @"");
        }

        [TestMethod]
        public void ActivitySurrogateTest()
        {
            DeserializeMaliciousPayload("ysoserial.exe -o base64 -g ActivitySurrogateSelector -f BinaryFormatter -c calc",
                @"");
        }

        [TestMethod]
        public void WindowsIdentityTest()
        {
            DeserializeMaliciousPayload("ysoserial.exe -o base64 -g WindowsIdentity -f BinaryFormatter -c calc",
                @"");
        }
    }
}
